import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Registration from './components/Registration';
import Login from './components/Login';
import Welcome from './components/welcome'; // Ensure this is the correct path
import Order from './components/orders/create-order'; // Import the new component
import AuthGuard from './components/'; // Import the new component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Registration />} /> {/* Set registration as the default page */}
        <Route path="/login" element={<Login />} />
        <Route path="/welcome" element={<Welcome />} />
        <Route 
                    path="/create-order" 
                    element={
                        <AuthGuard>
                            <CreateOrderPage />
                        </AuthGuard>
                    } 
                />

      </Routes>
    </Router>
  );
}

export default App;
